;; **
;;; Implementing SPEA 2 with algebolic functions using the expression call sign.
;; **

;; @@
(def spea2-range (* 3 3.14))

(def spea2-interval 0.2)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/spea2-interval</span>","value":"#'joel-spea2-algebolic/spea2-interval"}
;; <=

;; **
;;; Algeboblic requires data as a vector of coordinate vectors. (In this case one dimensional)
;; **

;; **
;;; **Data**
;; **

;; @@
(def xs (range 0.0 spea2-range spea2-interval))        ;Range of value indepednent varaible 
(def coords (mapv (fn [x] [x]) xs))      ;Vector of all indpendent variables "x"
(def spea2-data (map (fn [x] (Math/sin x)) xs))       ;Map of sine target values
(def vars '[x])										   ;Vector of xs
(def spea2-functions (expression/get-functions #{:div :minus :plus :times}))
(def spea2-terminals (expression/terminal-generators vars))
