;; **
;;; Import of `generation-config`  from SPEA-2 worksheet to control every aspect of the run. 
;;; 
;;; `generation-config` is already present in core.clj but we explicitly defn it here to allow tunable inputs.
;; **

;; @@
(def generation-config			     ; creates 
  (let [size-limit 120                   ; let used to spell out params ect.
        min-size 20
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 50
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 22}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation spea2-functions spea2-terminals 3) :repeat 6}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords spea2-data ex))}]
    {:ea-config              ea-config
     :score-functions        score-functions
     :reporting-function     (fn [z] (print ".") (flush))}))
