;; <=

;; @@
(def initial-zeitgeist
  (evolution/make-zeitgeist (genetics/ramped-half-and-half-population spea2-functions spea2-terminals 500 6)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/initial-zeitgeist</span>","value":"#'joel-spea2-algebolic/initial-zeitgeist"}
;; <=

;; @@
(time (def result (evolution/run-evolution generation-config initial-zeitgeist (fn [zg gc] (>= (:age zg) 5000)))))
