(plot/compose
  (plot/list-plot spea2-data :plot-range [:all :all])
  (plot/list-plot (interpreter/evaluate (:genotype (nth (sort-by :complexity < (:elite result)) 49))
                                        '[x]
                                        coords) :joined true))

print "Best expression sorted by error"

(plot/compose
  (plot/list-plot spea2-data :plot-range [:all :all])
  (plot/list-plot (interpreter/evaluate (:genotype (first (sort-by :error (:elite result))))
                                        '[x]
                                        coords) :joined true))


