;; **
;;; Comparison of complexity and score for memebrs of the population
;; **

;; @@
(defn plot-exp
  [exp size]
  (plot/compose
    (plot/list-plot spea2-data :plot-range [:all :all] :plot-size size)
    (plot/list-plot (interpreter/evaluate exp '[x] coords) :joined true)))
