;; **
;;; #Complexity Plots
;; **

;; @@
(defn get-nth-elite [n result] (:genotype (nth (sort-by :complexity < (:elite result)) n)))

(defn table-row-complex [n] ((juxt identity
                           tree/count-nodes
                           (fn [ex] (score/abs-error vars coords spea2-data ex))
                           #(plot-exp % 200)) (get-nth-elite n result)))

(table/table-view (mapv table-row-complex (vec (range 0 49 7))) :columns ["Genotype" "Complexity" "Score" "Plot"])
