(defn create-config
  "Creates an istance of a general spea2 config with limit n for the max population"
  [n]
  
  (def g-c			     ; creates 
  (let [size-limit n                   ; let used to spell out params ect.
        min-size 10
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 50
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 20}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation spea2-functions spea2-terminals 3) :repeat 10}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords spea2-data ex))}]
    {:ea-config              ea-config
     :score-functions        score-functions
     :reporting-function     (fn [z] (print "") (flush))})))
