;; @@
(defn evolve-result 
  "given an innital zeitgeist, general configuration, evolves soultions until a desired generation
  produces a 'result' - the final population"
  [g-c i-z gen] 
  (def r-result (evolution/run-evolution g-c i-z (fn [zg gc] (>= (:age zg) gen))))
  (println "defined a new r-result"))
