;; @@
(defn experiment-run
  
  "pop-range max = largest maximum population defined in the confgure
   pop-range-interval = the incremenetal steps over the pop-max range
   gen-evolve = number of evolutions for a generation
   run-repeat = number of iterations performed for each max-pop
   init-pop = innitial zeitgeist population size
  "
  
  [pop-range-max pop-range-interval gen-evolve run-repeat init-pop]

  (def x-coords []) 
  (def y-coords [])

  (loop [max-pop-size 20]
    
    (def temp-y [])
  
  	(println "max size" max-pop-size)
    	(def x-coords (conj x-coords max-pop-size))
  			(create-config max-pop-size)
    						(println "finished evolve")
    						
    
    ;;;;;
    
    						(loop [run 0]
                              	(create-iz init-pop)
                              		(evolve-result g-c init-z gen-evolve)
                              			(println "best score:"(best-of-gen r-result))
                             				 (def temp-y (conj temp-y (best-of-gen r-result)))
                              
                              
                              (if (< run run-repeat)         
                                
                              (recur (inc run))))
    
    (def y-coords (conj y-coords (run-average temp-y)))
    
    ;;;;
    
    
  	(if (< max-pop-size pop-range-max)
    
    (recur 	(+ pop-range-interval max-pop-size)))
    
    
  )
  (println "x-coords" x-coords)
  (println "y coords" y-coords)
  
  (def plot-coords (splerge x-coords y-coords) )
  
  (plot/compose
    (plot/list-plot plot-coords))
  )
